// 2. DOM references
const searchInput = document.querySelector('#searchInput');
const cardsContainer = document.querySelector('#cardsContainer');

displayCards(teamData);
// 4. Search Handler
searchInput.addEventListener('input', (e) => {
  const value = e.target.value.toLowerCase();
  const filteredTeam = teamData.filter(member => 
        member.name.toLowerCase().includes(value) || 
        member.role.toLowerCase().includes(value)
      );
      displayCards(filteredTeam);
    });
    // Function to create and display cards
    function displayCards(team) {
      if (team.length === 0) {
        cardsContainer.innerHTML = '<div class="no-results">No team members found matching your search.</div>';
        return;
      }
      cardsContainer.innerHTML = ''; // Clear old cards

  team.forEach(member => {
    const card = document.createElement('div');
    card.className = 'card';

    card.innerHTML = `
      <div class="card-image">
        <img src="${member.pic}" alt="${member.name}">
      </div>
      <div class="card-content">
        <h2>${member.name}</h2>
        <span class="card-role">${member.role}</span>
        <p>${member.bio}</p>
      </div>
      <div class="card-footer">
        <div class="social-links">
          <a href="${member.github}" target="_blank" title="GitHub">
            <svg width="18" height="18" fill="currentColor" viewBox="0 0 16 16">
              <path d="M8 0C3.58 0 0 3.58 0 8a8 8 0 0 0 5.47 7.59c.4.07.55-.17.55-.38v-1.33C4 14.52 3.5 13.3 3.5 13.3c-.36-.91-.88-1.15-.88-1.15-.72-.49.05-.48.05-.48.8.06 1.22.82 1.22.82.71 1.22 1.87.87 2.33.66.07-.52.28-.87.51-1.07-3.55-.41-7.28-1.78-7.28-7.93 0-1.75.62-3.18 1.64-4.3-.17-.4-.71-2.03.16-4.24 0 0 1.33-.42 4.36 1.63A15.16 15.16 0 0 1 8 3.41a15.1 15.1 0 0 1 3.96-.53c3.03-2.05 4.36-1.63 4.36-1.63.87 2.21.33 3.84.16 4.24a6.1 6.1 0 0 1 1.64 4.3c0 6.17-3.73 7.5-7.3 7.9.29.25.54.73.54 1.48v2.2c0 .21.15.46.55.38A8 8 0 0 0 16 8c0-4.42-3.58-8-8-8z"/>
            </svg>
          </a>
        </div>
      </div>
    `;

    cardsContainer.appendChild(card);
  });
    
}
